import { createRouter, createWebHashHistory } from 'vue-router'

import HelloWorld from '../components/HelloWorld'
import SomethingBeautiful from '../components/SomethingBeautiful'

const routes = [
  { path: '/', name: 'HomeScreen', component: HelloWorld },
  { path: '/second', name: 'SomethingBeaultiful', component: SomethingBeautiful }
]

const router = createRouter({
  history: createWebHashHistory(),
  routes
})

export default router
